import React from 'react';
import { Parallax, Background } from 'react-parallax';

function Jumbotron() {

    return (
        <div>
            <Parallax
                bgImage={require('./imgs/annie-spratt.jpg')}
                bgImageAlt="Jumbotron"
                strength={200}
            >
                <div style={{height: '400px'}}></div>
            </Parallax>
        </div>
    );
}

export default Jumbotron;
